<html><body><text id="wikipedia_ug_wikipedia_org__17265.html" ns="0" revid="144782" sourceurl="https://ug.wikipedia.org/wiki/%D8%A6%D8%A7%DA%86%DA%86%D9%89%D9%82_%D9%8A%DB%90%D8%B2%D9%89%D8%B3%D9%89" title="ئاچچىق يېزىسى" type="wikipedia">ئاچچىق يېزىسى<p><hi rend="bold">ئاچچىق يېزىسى</hi> دىگەن سۆزلۈك كۆپ خىل مەنە تۈرىنى ئىپادىلىگەن، تۆۋەندىكى مەنە تۈرلىرى بويىچە كۆرۈڭ:</p>
<list type="unordered"><item><ref target="https://ug.wikipedia.org/wiki/ئاچچىق_يېزىسى_(لوپ_ناھىيىسى)">ئاچچىق يېزىسى (لوپ ناھىيىسى)</ref>، خوتەن ۋىلايىتى لوپ ناھىيىسى قارمىقىدىكى يېزا؛</item>
<item><ref target="https://ug.wikipedia.org/wiki/ئاچچىق_يېزىسى_(يوپۇرغا_ناھىيىسى)">ئاچچىق يېزىسى (يوپۇرغا ناھىيىسى)</ref>، قەشقەر ۋىلايىتى يوپۇرغا ناھىيىسى قارمىقىدىكى يېزا؛</item></list></text></body></html>
